package tax.cute.mcpingplugin;

import java.io.*;

public class Util {
    public final static String MC_SRV = "_Minecraft._tcp.";
    public final static String MCSERVERDEFAULTFAVICONBASE64 = "";
    public static String combineArgs(String s, int start) {
        String[] args = s.split(" ");
        String str = "";
        for (; start < args.length; start++) {
            str += args[start];
        }
        return str;
    }

    public static boolean isNum(String data) {
        try {
            Long.parseLong(data);
            return true;
        } catch (NumberFormatException e) {
            return false;
        }
    }

    public static boolean isBoolean(String data) {
        return data.toLowerCase().equals("true") || data.toLowerCase().equals("false");
    }

    public static String readText(String path) throws IOException {
        return readText(path,"UTF-8");
    }

    public static String readText(String path,String charsets) throws IOException {
        InputStream in = new FileInputStream(path);
        return new String(in.readAllBytes(),charsets);
    }

    public static boolean createTypesetFile(String path) throws IOException{
        File file = new File(path);
        if(file.exists()) return false;
        OutputStream out = new FileOutputStream(path);
        String text =
                "%favicon\n" +
                        "[ 描述 ] %description\n" +
                        "[ 版本 ] %version_name(%version_protocol)\n" +
                        "[ 人数 ] %online_players/%max_players\n" +
                        "[ 延迟 ] %delay\n" +
                        "[ 类型 ] %type\n" +
                        "[ Mod数量 ] %mod_count";
        out.write(text.getBytes());
        return true;
    }
}
